window.JST = window.JST || {};
var template = function(str){var fn = new Function('obj', 'var __p=[],print=function(){__p.push.apply(__p,arguments);};with(obj||{}){__p.push(\''+str.replace(/\\/g, '\\\\').replace(/'/g, "\\'").replace(/<%=([\s\S]+?)%>/g,function(match,code){return "',"+code.replace(/\\'/g, "'")+",'";}).replace(/<%([\s\S]+?)%>/g,function(match,code){return "');"+code.replace(/\\'/g, "'").replace(/[\r\n\t]/g,' ')+"__p.push('";}).replace(/\r/g,'\\r').replace(/\n/g,'\\n').replace(/\t/g,'\\t')+"');}return __p.join('');");return fn;};
window.JST['breeze'] = template('<form>\n  <div class="form-inline">\n    Enter sequence\n    <textarea id="query" class="sequence" ng-model="query.sequence"></textarea>\n    <button class="btn btn-primary" ng-click="makeQuery()">Blast</button>\n  </div>\n  <div class="form-inline">\n    Input:\n      <input type="radio" name="type" ng-model="query.input" value="dna" /> DNA\n      <input type="radio" name="type" ng-model="query.input" value="protein" /> Protein\n    Databases:\n    <span ng-repeat="(db, url) in databases">\n      <input type="radio" name="database" ng-model="query.db" value="{{ db }}" /> {{ db }}\n    </span>\n  </div>\n</form>\n\n<partial template="results"></partial>\n');
window.JST['results'] = template('<p ng-if="submitted === true && results === null">\n  Searching ...\n</p>\n\n<div ng-if="results !== null">\n\n<p>\n  {{ results.length }} matches from your search.\n</p>\n\n<div ng-repeat="result in results">\n  <p> {{ result.res.label }}:\n      <span ng-if="result.obj">\n        <a href="{{ result.obj.url }}">{{ result.obj.name }}</a>\n        ({{ result.obj.length }} bps).\n      </span>\n      e-value: {{ result.res.evalue }}.\n      identities: {{ result.res.identities }}/{{ result.res.alignment.match.length }}.\n  </p>\n\n  <ul>\n    <li> query: {{ result.res.start }} - {{ result.res.end }} </li>\n    <li> match: {{ result.res.subject_start }} - {{ result.res.subject_end }} </li>\n  </ul>\n\n  {{ result.res.alignment.query }}\n  {{ result.res.alignment.match }}\n  {{ result.res.alignment.subject }}\n\n</div>\n\n\n</div>\n\n');
